import React from 'react';
import './Arrow.css';
import { HiArrowLeft } from 'react-icons/hi';
import Media from 'react-media';
import { useNavigate } from 'react-router-dom';

// REturn Arrow component 
export default function REturnArroW() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 const navigation = useNavigate();
 return (
  <div onClick={() => navigation(-1)} className='wrp-arrow-phone'>
   <div className='wrp-icon'>
    <HiArrowLeft size={'1.8em'} />
   </div>
   <div>
   </div>
  </div>
 )
}
export const ScreenSmall = () => {
 const navigation = useNavigate();

 return (
  <div onClick={() => navigation(-1)} className='wrp-arrow-phone-sm'>
   <div className='wrp-icon'>
    <HiArrowLeft size={'1.8em'} />
   </div>
   <div>
   </div>
  </div>
 )
}
